import { FC, useEffect, useState } from "react";
import { getUser } from "../../utils/localStorageFunctions";
import { checkUser } from "../../utils/validateUser";
import { useNavigate } from "react-router-dom";
import { landMeToPage } from "../../utils/navigation";

const Singin: FC = () => {
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [message, setMessage] = useState("");
  const navigation = useNavigate();
  useEffect(() => {
    if (getUser()) {
      const { user } = getUser();
      landMeToPage(navigation, user.role);
    } else {
      console.log("invlid Access");
    }
  }, [navigation]);

  const findUser = (e: any) => {
    e.preventDefault();
    const getData = async () => {
      const data = await checkUser(email, password);
      if (data) {
        const { user } = getUser();
        landMeToPage(navigation, user.role);
      } else {
        setMessage("invalide email and password");
      }
    };
    getData();
    return "";
  };

  return (
    <>
      <div className="flex items-center min-h-screen bg-gray-50">
        <div className="flex-1 h-full max-w-4xl mx-auto bg-white rounded-lg shadow-xl">
          <div className="flex flex-col md:flex-row">
            <div className="h-32 md:h-auto md:w-1/2">
              <svg
                xmlns="http://www.w3.org/2000/svg"
                xmlnsXlink="http://www.w3.org/1999/xlink"
                width={500}
                height={500}
              >
                <image
                  width={500}
                  height={500}
                  xlinkHref="data:image/png;base64,"
                />
              </svg>
            </div>
            <div className="flex items-center justify-center p-6 sm:p-12 md:w-1/2">
              <div className="w-full">
                <div className="flex justify-center"></div>
                <h1 className="mb-4 text-2xl font-bold text-center text-gray-700">
                  Login to Your Account
                </h1>
                <div>
                  <label className="block text-sm">Email</label>
                  <input
                    onChange={(e) => {
                      setEmail(e.target.value);
                    }}
                    type="email"
                    className="w-full px-4 py-2 text-sm border rounded-md focus:border-blue-400 focus:outline-none focus:ring-1 focus:ring-blue-600"
                    placeholder=""
                  />
                </div>
                <div>
                  <label className="block mt-4 text-sm">Password</label>
                  <input
                    onChange={(e) => {
                      setPassword(e.target.value);
                    }}
                    className="w-full px-4 py-2 text-sm border rounded-md focus:border-blue-400 focus:outline-none focus:ring-1 focus:ring-blue-600"
                    placeholder=""
                    type="password"
                  />
                </div>
                <p className="mt-4">
                  <a
                    className="text-sm text-blue-600 hover:underline"
                    href="./forgot-password.html"
                  >
                    Forgot your password?
                  </a>
                </p>
                <p className="mt-4">
                  <div className="text-sm text-blue-600 hover:underline">
                    {message}
                  </div>
                </p>
                <button
                  onClick={findUser}
                  className="block w-full px-4 py-2 mt-4 text-sm font-medium leading-5 text-center text-white transition-colors duration-150 bg-blue-600 border border-transparent rounded-lg active:bg-blue-600 hover:bg-blue-700 focus:outline-none focus:shadow-outline-blue"
                >
                  Log in
                </button>
              </div>
            </div>
          </div>
        </div>
      </div>
    </>
  );
};

export default Singin;
